import '../css/home.css' ;


function home() {


    return (
        <body>

            <div class="landingpage">



            <div class="box">
            <div class="infobox">

                <p class="infobox-slimtext">Expert Advisor </p>
                <p class="infobox-boldtext">สุดยอด EA Forex  </p> <br></br>
                <p class="infobox-boldtext">ที่เปิดให้ใช้โดยไม่ต้อง <br></br> ซื้อ!!  </p>
                <p class="infobox-slimtext">ทำกำไรเฉลี่ยเดือนละ 20-30% การันตีด้วยผล Back Test ทำกำไรจาก 10,000$  ไป 35,377$ ภายใน 1 ปี และมี Drawdown อยู่เพียงแค่ 00.00%</p>
                <div class="infobox-btnwrapper">
                <button class="infobox-explorebtn selected">Explore</button>
                <button class="infobox-createbtn">Create</button>
                </div>
            </div>

            </div>

        </div>


        </body>
    );
  }

  export default home;
